#It couldn’t be more simple:

1). Deposit a NFT into the Vault;

2). Automatically receive a related wrapped token which tracks the combined value, at a set ratio;

3). Burn the wrapped token to withdraw any NFT locked in the corresponding Vault.

#Wrap the World

Wrapped Token Vaults open the door to a new world of DeFi freedom as complex structures can grow around this simple protocol.

# Ok... Who cares?

Imagine that a different asset with more utility replaces 
@AvaStarsNFT
 . Evoking The Big Short, the token might be a CDO backed by loans and mortgages. 

@AvaStarsNFT
  is not the first project to have wrapped assets into a basket. However, this is one of the more tangible examples where a fungible asset is backed by a pool of illiquid, unique assets on the blockchain.
